import { Box, Center, Flex, Grid, Stack, Text } from "@mantine/core";
import React from "react";

const Layout = () => {
  return (
    <Box bg="red.500">
  <Stack>
    <Box bg="gray.400">
      <Center>
        <Text>Test</Text>
      </Center>
    </Box>
    <Flex>
      <Grid templateColumns="repeat(3)" gap={4}>
        <Box>Test</Box>
        <Box>Test</Box>
        <Box>Test</Box>
      </Grid>
    </Flex>
  </Stack>
</Box>
  );
};

export default Layout;
